function App() {
  const [users, setUsers] = useState<IUser[]>([]);

  async function fetchUsers() {
    try{
        const response = await axios.get('')
    } catch(e){
      alert(e)
    }
  }


  return (
    <div className="App">
      <Card
        width="200px"
        height="200px"
        variant={CardVariant.primary}
        onClick={() => {
          console.log("click");
        }}>
        <button> Click me </button>
      </Card>
      <UserList users={users} />
    </div>
  );
}

export default App;
